//convolution function for kernel length 10
void convolve10(float *samples, float *kernelWeights, float *kernelBiases, float *results){
	float acc;
	int ks, ke, ss, se; //adapt the length of the kernel at the ends for 'padding'
	int indatIndex,outdatIndex, kernelIndex, sampleIndex;
	for(int sensor=0;sensor<14;sensor++){ //**remember to set this back to 14! :)
		indatIndex = 0;
		outdatIndex = 0;
		kernelIndex = sensor*10;
		//kernel of length 10, convolved with vector of length 30, zero padded so output is also a vector of length 30
		for(int mto=0;mto<30;mto++){ 
			acc = 0.0f;
			if(mto<4){ks = 4-mto;} else {ks=0;} //for iterations 0-2, we trim the start of the kernel to effect zero padding
			if(mto>24){ke = 34-mto;} else {ke=10;} //zero padding at the other end too, to match the Keras implementation
			if(mto<5){ss = 0;} else {ss = mto-4;}
			sampleIndex = ss+(sensor*30);
			for(int j=ks;j<ke;j++){
				acc += kernelWeights[kernelIndex+j] * samples[sampleIndex++];
			}
			acc += kernelBiases[sensor];
			results[mto+(sensor*30)] = (float)(exp(acc) - exp(-acc)) / (exp(acc) + exp(-acc)); //add tanh activation function and store
		}
	}
}

//convolution function for kernel length 3
void convolve3(float *samples, float *kernelWeights, float *kernelBiases, float *results){
	float acc;
	int ks, ke, ss, se; 
	int indatIndex,outdatIndex, kernelIndex, sampleIndex;
	for(int sensor=0;sensor<14;sensor++){
		indatIndex = 0;
		outdatIndex = 0;
		kernelIndex = sensor*3;
		for(int mto=0;mto<28;mto++){ //no zero padding this time!
			acc = 0.0f;
			sampleIndex = (sensor*30)+mto;
			for(int j=0;j<3;j++){ //3 long kernel
				acc += kernelWeights[kernelIndex+j] * samples[sampleIndex++];
			}
			acc += kernelBiases[sensor];
			results[mto+(sensor*28)] = (float)(exp(acc) - exp(-acc)) / (exp(acc) + exp(-acc)); //add tanh activation function and store
		}
	}
}

//fully connected neural layer with 100 neurons
void dense100(float *inData, float *kernelWeights, float *kernelBiases, float *results){
	float acc;
	for(int n=0;n<100;n++){ //100 neurons in the layer
		acc = 0.0f;
		for(int i=0;i<392;i++){ //392 wide input space, makes 39200 weights in total, plus 100 biases
			acc += kernelWeights[i+(n*392)] * inData[i]; //accumulate a neuron with 392 inputs
		}
		results[n] = (float)(exp(acc) - exp(-acc)) / (exp(acc) + exp(-acc)); 
	}
}

//single output neuron
void dense1(float *inData, float *kernelWeights, float *kernelBiases, float *results){
	float acc;
	acc = 0.0f;
	for(int i=0;i<100;i++){ //100 wide input space
		acc += kernelWeights[i] * inData[i]; //accumulate one neuron with 100 inputs
	}
	results[0] = acc; //linear activation on last neuron 
}

